(4, 'Alka Tech (Pvt) Ltd', 'Alka Tech (Pvt) Ltd offer many services to entertain couples and guests. DJs may bring their own equipment, including a dance floor lighting, a flat screen, a photo booth, sound/PA system, a projector, microphones, and uplighting. Steve will consult with couples to craft a Do-Not-Play list as well as make sure all the music is up to their desires and needs.Alka Techs will emcee, provide karaoke and one event per day. ', '100000.00', , '0727311322', 'info@alkatech.lk', 'www.alkatech.net');
INSERT INTO `bands` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
(5, 'Cine Media Studio & Sounds', 'During your consultation with the Cine Media Studio & Sounds, you can tell them all about the music you want to hear on your big day. Whether you prefer old-school classics or contemporary hits, their DJs are happy to play tracks from a wide selection of genres. The business can provide your event with both a DJ and an MC. A range of equipment is available, including disco balls, flat screens, projectors, and PA systems. As well as specializing in DJing, Cine Media Studio & Sounds offers lighting and photo booth services', '125000.00', , '0717424410', 'info@cinemedia.lk', 'www.cinemedia.lk');
