(7, 'Faith Music Band', 'The Faith Music Band has a number of services available for your entertainment needs. Their most popular package includes lighting, music during breaks and an MC, among other services. With the ability to learn new songs, you can make sure that every special song is played on your special day. ', '50000.00', , '0251238123', 'info@faithmusicband.lk', 'www.faithmusicband.lk');
